using CloudinaryDotNet;
using CloudinaryDotNet.Actions;
using CSLY.MyAuthorizations;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Web.Http;

namespace CSLY.Controllers.api
{
    [JwtAuthorize]
    public class UploadImageToCloudinaryController : ApiController
    {
        public static Cloudinary cloudinary;

        public const string CLOUD_NAME = "dcrllmnai";
        public const string API_KEY = "581332317551619";
        public const string API_SECRET = "Jm_ZH12L6l2RURuM37zqmjwGwBo";

        [HttpPost]
        public IHttpActionResult UploadImage()
        {
            string imagePath = "data:image/jpeg;base64,";
            Account account = new Account(CLOUD_NAME, API_KEY, API_SECRET);
            cloudinary = new Cloudinary(account);
            try
            {
                var uploadParams = new ImageUploadParams()
                {
                    File = new FileDescription(imagePath)
                };
                return Ok(cloudinary.Upload(uploadParams).Url);
            }catch(Exception e)
            {
                Console.WriteLine(e);
            }
            return Ok();
        }
    }
}
